import React, { Component } from "react";
import classes from "./show.module.css";
class Show extends Component {
  clickHandler = () => {};
  render() {
    let data = this.props.data;
    return (
      <ul className={classes.table} onClick={this.clickHandler}>
        <li>{data[0]}</li>
        <li>{data[1]}</li>
        <li>{data[2]}</li>
        <li>{data[3]}</li>
      </ul>
    );
  }
}
export default Show;
